import React from 'react'
//import ReactDOM from 'ract-dom'
import { Component } from 'react'
import Node from "./Node"
const Grid=()=>{

    var temp=[],a=[]
    for(var i=0;i<4;i++)
        {
            for(var j=0;j<4;j++)
            {
                temp[j]= <Node isWall={true}></Node>
            }
            a[i]=temp
        }
    return(
        <div>
            {a}
        
        </div>
    )
};
export default Grid;
